import React from 'react'

const defaultProps = {
    backgroundImage: "https://mdbootstrap.com/img/Photos/Others/architecture.jpg" ,
}

export default class Container extends React.Component {
    render () {
        return (
            <div className="jumbotron view animated fadeIn delay-06s delay-1s" style={{backgroundImage: `url('${!this.props.backgroundImage ? defaultProps.backgroundImage : this.props.backgroundImage}')`, color: '#000000'}}>
                <div className="container">
                <div className="mask blue-gradient-rgba flex-center">

                        <h2 className="display-3 text-center text-white animated fadeInLeft delay-06s">{this.props.title }</h2>
                    </div>
                </div>
            </div>
        )
    }
}
